#!/usr/bin/env python3

myset1 = set('3''14''15''9''26''5''35''9')
myset2 = set('60''22''14''0''9')

print(myset1)
print(myset2)

difference = myset1 - myset2
print(f' The difference of the sets is: {difference}.')

union = myset1 | myset2
print(f' The union of the sets is: {union}.')

symdiff = myset1^myset2
print(f' The symmetric difference of the sets is: {symdiff}.')


